import React from "react";
import PropagateLoader from "react-spinners/PropagateLoader";

const ActivateForm = ({ type, header, text, loading }) => {
  return (
    <div className="blur">
      <div className="popup">
        <div className="popup_header">Account verification succeded</div>
        <div className="popup_message"></div>
      </div>
      <PropagateLoader />
    </div>
  );
};

export default ActivateForm;
